import React, { useEffect, useState } from 'react'
import './Home.css';

export default function Home() {
  let [product,setProduct] = useState(null)
  useEffect(()=> {
    
      fetch("https://assessment.api.vweb.app/rides")
      .then((response) => response.json())
      .then((data)=> {
        setProduct(data);
      })
      
    
  },[])
  
  console.log(product);
  if(product) {
    return (
      <>
          {product.map((item) => {
            return (
              <>
              <div className="container">
                <div className="container_image">
                
                </div>
                <div className="container_box">
                <div className='ride_id'> Ride id : {item.id}
              </div>
              <div className='origin_station'>Origin Station : {item.origin_station_code} </div>
              <div className="station_container">
              <span className='station_path'>station_path : 
                {item.station_path.map((x)=> {
                  return (<span className='station_path_no'>{x} </span>)
                })}
              </span>
              </div>
              
              <div className='date'>Date : {item.date}</div>
                </div>
              </div>
              
              
              </>
            )
          })
        } 
      </>
    )
    }
}
